      payment_id: {
        allowNull: true,
        type: DataTypes.INTEGER,
        references: {
          model: "Payment",
          key: "payment_id",
        },
      },
    },
    {
      sequelize,
      modelName: "Order_detail",
    }
  );
  return Order_detail;
};

