sourcesContent:
import otpGenerator from 'otp-generator';
import db from '../models/index';

const generateOtp = () => {
    return otpGenerator.generate(4, { upperCase: false, specialChars: false, alphabets: false, digits: true });
}
// Save OTP to user
const saveOtp = async (email, otp) => {
    try {
        const user = await db.User.findOne({ where: { email: email } });
        if (user) {
            user.otp = otp; // Set the OTP
            await user.save(); // Save the updated user
            console.log(`OTP saved for user: ${email}`);
        } else {
            console.log(`User not found for email: ${email}`);
        }
    } catch (error) {
        console.error('Error saving OTP:', error);
        throw error; // Throw error if any issue occurs
    }
}

// Verify OTP
const verifyOtp = async (email, otp) => {
    try {
        const user = await db.User.findOne({ where: { email: email, otp: otp } });
        return user ? true : false;
    } catch (error) {
        throw error;
    }
}

// Delete OTP after use
const deleteOtp = async (email) => {
    try {
        const user = await db.User.findOne({ where: { email: email } });
        if (user) {
            user.otp = null;
            await user.save();
        }
    } catch (error) {
        throw error;
    }
}

export default {
    generateOtp,
    saveOtp,
    verifyOtp,
    deleteOtp
};

